#define PID 1016
#define BSIZE 4096

int isInFile(const char fname[]){
        int l=strlen(fname);
        if (l<=3||strcmp(fname+l-3,".in")!=0) return 0;
        else return l-3;
}

int main(){
    int i=1;
	int namelen=0;
	char dirpath[BSIZE],outfile[BSIZE],fname[BSIZE],cmd[BSIZE];
    DIR *dp;
    FILE * f;
    f=fopen ("c:\\JudgeOnline\\serverconfig.property","r");
    while (fgets(cmd,BSIZE-1,f)){
                cmd[strlen(cmd)-1]=0;
                if (strncmp(cmd,"DataFilesPath=",14)==0){
                        strcpy(cmd,cmd+14);
                        break;
                }
        }

    for(i=0;i<strlen(cmd);i++){
            if(cmd[i]=='\\')
               strcpy(cmd+i,cmd+i+1);
    }

    fclose (f);
    struct dirent *dirp;
    sprintf(dirpath,"%s\\%d",cmd,PID);

    for(i=0;(dp=opendir(dirpath))==NULL;i++){

      sprintf(dirpath,"%c:\\data\\%d",'c'+i,PID);

    }

    for (;(dirp=readdir(dp))!=NULL;){
                namelen=isInFile(dirp->d_name);
                if (namelen==0) continue;
                strncpy(fname,dirp->d_name,namelen);
                fname[namelen]=0;
                sprintf(outfile,"%s\\%s.out",dirpath,fname);
                sprintf(cmd,"type %s",outfile);
                //printf(cmd);
                system(cmd);
    }
    return 0;
}

#include "iostream"
#include "math.h"
#include "algorithm"
using namespace std;

double v,minimum;
double a[8][4]={0};
int n,record[8];

double compute (double guidx,double guidy,double kidx,double kidy,double vx,double vy)
{
    double a,b,c;
    c = ( guidx - kidx )*( guidx - kidx ) + ( guidy - kidy )*( guidy - kidy );
    b = 2*( ( kidx - guidx  )*vx + (  kidy - guidy  )*vy ) ;
    a = vx*vx + vy*vy -v*v;
    return (-b-sqrt(b*b-4*a*c))/(2*a) ;
    
}

int main ()
{
    int i;
    double tempx,tempy;
    double guidx,guidy;
    double max,time;
    double addtime,kidtime;
    double k1,k2;
    //double minimum;
    
    //int m;
    //freopen("in.txt","r",stdin);
    
    for(;scanf("%d",&n)!=EOF && n;)
    {
        scanf("%lf",&v);
        for(i=0;i<n;i++)
            scanf("%lf %lf %lf %lf",&a[i][0],&a[i][1],&a[i][2],&a[i][3]);
        
        //memset(record,0,sizeof(record));
        for(i=0;i<n;i++)
            record[i] = i;
        
        minimum=0xFFFFFFF;
        
        do
        {
            max=0;
            guidx=0;
            guidy=0;
            time=0;
            kidtime = 0;
            for(i=0;i<n;i++)
            {
                k1=sin(a[ record[i] ][3]);
                k2=cos(a[ record[i] ][3]);
                tempy=k1*a[ record[i] ][2]*time+a[ record[i] ][1];
                tempx=k2*a[ record[i] ][2]*time+a[ record[i] ][0];
                
                addtime = compute(guidx,guidy,tempx,tempy,k2*a[ record[i] ][2],k1*a[ record[i] ][2]);
                guidx = tempx + addtime*k2*a[ record[i] ][2];
                guidy = tempy + addtime*k1*a[ record[i] ][2];
                time += addtime;
                if(time + sqrt(guidx*guidx + guidy*guidy)/a[ record[i] ][2] > kidtime )
                    kidtime = time + sqrt(guidx*guidx + guidy*guidy)/a[ record[i] ][2];				 
            }
            if(kidtime < minimum)
                minimum =kidtime;
        }while( next_permutation( record , record+n ) );
        //next_permutation
        
        printf("%.0lf\n",minimum);
    }
    return 1;
}

#include <stdio.h>
#include <string.h>

int eva(char *num, int len)
{
	int i;
	char sum[512];

	for (i = 1 ; i < len ; i++)
	{
		memset(sum, 0, sizeof(sum));
		strncpy(sum, num + i, len - i);
		strncpy(sum + len - i, num, i);
		if (strncmp(num, sum, len) > 0)
			return 0;
	}

	return 1;
}

int main(void)
{
	int n, i, j;
	int len;
	char *p;
	char num[512];

	scanf("%d%*c", &n);
	while (n--)
	{
		gets(num);
		p = num;
		while (len = strlen(p))
		{
			for (j = len ; !eva(p, j) ; j--)
				;
			putchar('(');
			for (i = 0 ; i < j ; i++)
				putchar(*(p + i));
			putchar(')');
			p += j;
		}
		putchar('\n');
	}

	return 0;
}
